import React from "react";
import Styling from "./styleModules/LeftSidebar.module.css";
import { mdiHome, mdiViewDashboard } from "@mdi/js";
import Icon from "@mdi/react";

function LeftSidebar() {
  return (
    <div className={Styling.mainContainer}>
      <div className={Styling.titleContainer}>
        <icon className={Styling.titleIcon} />
        <div className={Styling.title}>Title</div>
      </div>

      <div className={Styling.generalNavContainer}>
        <div>
          <Icon className={Styling.navIcon} path={mdiHome} /> home
        </div>
        <div>profile</div>
        <div>messages</div>
        <div>history</div>
        <div>tasks</div>
        <div>communities</div>
      </div>
      <div className={Styling.supportContainer}>
        <div>settings</div>
        <div>support</div>
        <div>privacy</div>
      </div>
    </div>
  );
}

export default LeftSidebar;
